Thanks Andy for the tip. I modified in access point 80:xml, &quot;replayPrefix&quot;
and the &quot;replayURIPrefix&quot; to http://www.xyz.com/xml/ , restarted tomcat. but
no change. I receive the same error message.





From: archive-crawler@yahoogroups.com
[mailto:archive-crawler@yahoogroups.com] On Behalf Of Andrew Jackson
Sent: Thursday, May 30, 2013 5:29 PM
To: archive-crawler@yahoogroups.com
Subject: Re: [archive-crawler] Wayback Access Point problem





Hi,



I think you&#39;ll find it works more reliably if you set up the access point as



http://www.xyz.com/xml/

rather than



http://www.xyz.com/archives/xml/

I believe trying to set up one access point inside another one will confuse
Wayback.



Thanks,

Andy



On 30 May 2013, at 15:25, Ferencz Marton wrote:









